  return (
    <>
       <div className="main_container">
        <p className="text">
          SIGN UP YOUR ACCOUNT
          <span> fill all form field to go to next step</span>
        </p>
        <p>
        <strong>First Name :</strong> {email}{" "}

        </p>
        <p>
        <strong>First Name :</strong> {username}{" "}

        </p>
        <p>
        <strong>First Name :</strong> {password}{" "}

        </p>
        <p>
        <strong>First Name :</strong> {confirmpassword}{" "}

        </p>
        
        </div>
       
    </>
  )
}
export default FinalStep
